values("Chris Hemsworth", "bringd0wntheMjolnir", "https://pixel.nymag.com/imgs/fashion/daily/2017/07/25/Chris-Hemsworth/25-Chris-Hemsworth.w330.h412.jpg", "Native Australian here, so you know I’m good at wrestling with any dangerous animal out there. Not only am I a nerd, but I’ve starred in movies in the Marvel Cinematic Universe (MCU) as a Norse God. I have access to a bunch of the movie props and you could possibly meet some of my other MCU friends if we were to date. Born in Australia, I also love to do non-nerdy things, such as surfing and jogging on the beach. I am not your typical nerd, but I do dress up pretty often.", "M", "35", "4, 2, 1,5, 2, 4, 1, 5, 1, 3, 1, 3, 4, 5, 2", "Python"),
("Lyndsey Scott", "BeautywithBrains", "https://pbs.twimg.com/media/D1t7PZMU8AEhrR2.jpg", "I am an American model, who would like to turn around the stereotype that all models are just looks with no brains. As Calvin Klein’s first African-American exclusive model, I feel I have a lot to offer. I am one of the top iOS responders on Stack Overflow and have done tutorial videos for children with other well-known coders, such as Bill Gates and Mark Zuckerberg. My love for coding started at the age of 12 and I can code in various languages, some of them: Java, C++, Python, Objective C, and iOS. My dream is to inspire other young girls to get into software development and enter the field.", "F", "35", "2, 4, 1, 5, 2, 4, 5, 5, 2, 1, 2, 4, 3, 2, 1", "Python"),
("Grace Hopper", "NavyRulesArmyDr00l$", "https://www.engineerbabu.com/blog/wp-content/uploads/2016/12/grace-hopper-3-600x403-1.jpg", "I am an American computer scientist and Navy rear admiral. Due to my popularization of machine-independent programming languages, the development of COBOL was started. I also have my PhD in mathematics from Yale and was a mathematics professor. I always believed that programming in the English language was possible, so I built a compiler that converted English terms into machine code that is understood by computers. I also love to take things apart, to see how they work from the inside.", "F", "65", "1, 5, 2, 3, 4, 2, 3, 1, 2, 3, 2, 4, 1, 5, 2", "COBOL"),
("Natalie Portman", "TheProfessionalNerd", "http://images6.fanpop.com/image/photos/41600000/Natalie-Portman-natalie-portman-41650501-767-767.jpg", "You may not think of me as a nerd, being an American actress in so many movies. However, I have starred in the Star Wars franchise when I was only in high school and even missed the premiere of the movie to study for my finals. I also have attended Harvard, because I think education is important. I have also starred in the Marvel Cinematic Universe, making it so I have been in many nerdy universes. Animal rights and the environment are two of my current causes that I love to support.", "F", "37", "3, 1, 5, 3, 4, 2, 4, 5, 1, 3, 3, 2, 1, 5, 3", "Ruby/Rails"),
("Frances Elizabeth 'Fran' Allen", "IBMfellowLady", "https://www.berkeley.edu/news/berkeleyan/2008/01/images/franallen1.jpg", "I am an American computer scientist and known for being a pioneer in optimizing compilers. I am also the first female IBM Fellow and the first woman to win the Turing award. I grew up on a farm, so I am really good with animals. However, I also have a background in teaching, so I am really good with kids also. Some of my other achievements include having my degree in mathematics, which helped me to lay down the groundwork for automatic program optimization technology.", "F", "86", "5, 1, 3, 2, 4, 5, 2, 3, 1, 4, 1, 3, 2, 4, 5", "SQL"), ("Tony  Fadell", "NestDude", "https://upload.wikimedia.org/wikipedia/commons/thumb/6/67/Tony_Fadell.jpg/440px-Tony_Fadell.jpg", "I am an engineer, inventor, designer, entrepreneur, and angel investor. I am known as 'one of the fathers of the iPod' for my work on the first generations of Apple's music player. In May 2010, I founded Nest Labs. Now, after 26 years in Silicon Valley, I am living in France and enjoying cheese.", "M", "50", "2, 4, 3, 1, 5, 4, 4, 3, 5, 3, 5, 3, 1, 4, 5", "BASIC"),
("Gary Shteyngart", "SmartyPantsBabushka101", "https://upload.wikimedia.org/wikipedia/commons/thumb/a/af/GaryShteyngart.jpg/440px-GaryShteyngart.jpg", "Born in the Soviet Union, I spent the first seven years of my childhood living in a square dominated by a huge statue of Vladimir Lenin in St. Petersburg, which I alternately call St. Leningrad. With a degree in politics I am a Random House best-selling author of Absurdistan, Lake success, Super Sad True Love Story to name a few. I am fluent in Russian, and enjoy Java very much, test me!", "M", "46", "2, 4, 3, 5, 1, 3, 5, 3, 4, 2, 2, 1, 4, 5, 3", "Java"),
("Mayim  Bialik", "BlossomTheory", "https://pbs.twimg.com/profile_images/822196051083808768/ZuIqS-lf.jpg", "From 1991 to 1995, I played the title character of the NBC sitcom Blossom. I also played a role in The Big Bang Theory. A lot of folks don’t know that I am also a neuroscientist at UCLA. My name Mayim means 'Water' in Hebrew, I am a Sagittarius. I enjoy cooking and follow vegan diet. Fun fact about me, I can play the piano, bass guitar and the trumpet.", "F", "43", "1, 3, 4, 2, 5, 2, 2,4, 2, 1, 3, 4, 2, 5, 2", "JavaScript,"), ("Sophie Wilson", "ItsSophieW", "https://upload.wikimedia.org/wikipedia/commons/b/b3/Sophie_Wilson.jpg",
"Hello everyone. I hail from England, cheers m8. I designed the Acorn Micro-Computer, the first of a long line of computers sold by Acorn Computers Ltd, including its programming language BBC BASIC. I later designed the instruction set of the ARM processor, which is used in most 21st-century smartphones. I now serve as a director at the technology conglomerate Broadcom Inc.", "F", "62", "4, 4, 0, 5, 1, 5, 2, 2, 0, 3, 5, 1, 0, 2, 1", "PHP"), 
("Tom Preston-Werner", "TommyBoiii", "https://upload.wikimedia.org/wikipedia/commons/thumb/0/0b/Tom_Preston-Werner.jpg/330px-Tom_Preston-Werner.jpg","I am a software developer and entrepreneur. Additionally, I am an active contributor within the open-source development community, most prominently in the San Francisco Bay Area, where I live. I am best known as the founder and former CEO of GitHub a Git repository web-based hosting service, which I co-founded in 2008. For fun I study cultural anthropology.", "M", "39", "2, 4, 3, 2 ,1 ,5, 5 ,1, 3, 2, 1, 2, 1, 2, 3", "PHP"), ("Rasmus Lerdof", "LilRasmus", "https://upload.wikimedia.org/wikipedia/commons/thumb/6/66/Rasmus_Lerdorf_August_2014_%28cropped%29.JPG/330px-Rasmus_Lerdorf_August_2014_%28cropped%29.JPG", 
"I am a Danish-Canadian programmer. I created the PHP scripting language, authoring the first two versions of the language and participated in the development of later versions. For fun I travel the world meeting all the other people named Rasmus out there.", "M", "50", "5, 1, 2, 4, 3, 1, 5, 3, 4, 2, 1, 2, 5, 3, 1", "C#"), ("Steve Wozniak", "FreakySteve", "https://upload.wikimedia.org/wikipedia/commons/thumb/b/bf/Steve_Wozniak%2C_November_2018.jpg/330px-Steve_Wozniak%2C_November_2018.jpg", "I am an American inventor, electronics engineer, programmer, philanthropist, and technology entrepreneur who in 1976 co-founded a little company called Apple, maybe you’ve heard of it? I used to date Kathy Griffin. For fun I like playing Tetris and counting my money.", "M", "68", "3, 2, 5, 1, 2, 2, 5, 1, 2, 5, 4, 4, 3, 1, 1", "SQL"), ("Brendan Eich", "BeautifulBrendan", "https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/Brendan_Eich_Mozilla_Foundation_official_photo.jpg/330px-Brendan_Eich_Mozilla_Foundation_official_photo.jpg", "I am an American technologist and creator of the JavaScript programming language. I also co-founded the Mozilla project, the Mozilla Foundation and the Mozilla Corporation, and served as the Mozilla Corporation's chief technical officer and briefly its chief executive officer. I also have a company called SpiderMonkey-isn’t that a cool name?", "M", "57", "2, 5, 1, 2, 2, 4, 3, 2, 3, 1, 3, 3, 5, 1, 1", "Objective-C"), ("Bill Gates", "SlickBilly6", "https://timedotcom.files.wordpress.com/2014/01/bill-gates.jpg", "I am Bill. I started Microsoft in 1975, which for years was the world’s largest software company. I built my first computer programs in the BASIC and COBOL languages. People say that I’m mean and robotic but I don’t care because I like robots. I bought a collection of scientific writings by Leonardo da Vinci, which is kind of cool. I enjoy reading, bridge, tennis and golf.", "M", "63", "2, 4, 1, 3, 5, 5, 2, 3, 2, 3, 3, 2, 5, 4, 2", "COBOL"), ("Sid Meier", "SIDVISCIOUS", "http://cdn.themis-media.com/media/global/images/library/deriv/85/85059.jpg", "I’ve made computer games for a while, and you might recognize the Civilization series. My favorite programming languages over my life have been C when I was younger, and Python in just the past few years. When I’m not creating awesome video games, I play organ in church and sing in the choir. It is little known that I am a Canadian and Swiss citizen.", "M", "65", "2, 2, 1, 5, 4, 5, 3, 5, 2, 2, 1, 2, 3, 3, 5", "JavaScript"), ("Morena Baccarin", "MoraB52", "https://cdn1.thr.com/sites/default/files/imagecache/NFE_portrait/2014/04/morena_baccarin.jpg", "Hey everyone my name is Morena and I’m looking for new friends and people to share my my new-newfound love of coding with! I’ve acted in cult classics such as Firefly and the Deadpool series, but I swear that I’m down to earth. While inexperienced in coding, I was looking for cool people who can teach me a Javascript, and maybe a little more!", "F", "39", "2, 5, 2, 3, 1, 5, 5, 5, 3, 2 , 5, 2, 2, 3, 3", " C/C++"), ("Brian May", "EarthIsRound61", "https://i.pinimg.com/236x/27/1a/f6/271af6a2a5576eba5e490cc5881e82f2--best-guitarist-wall-of-sound.jpg?b=t", "Pleased to meet you! I’m Brian. People might know me as the guitarist from the band Queen. Most people don’t know that I am also a renowned astrophysicist. I am fascinated by the implications of programming and coding in science and music, and was hoping that I could collaborate with programmers to make a robot-rock-opera.", "M", "71", "3, 3, 4, 4, 1, 3, 1, 1, 5,  5, 2, 1, 4, 4, 4", "Ruby/Rails"), ("Julianne Pierce", "WomenPrgrmrsRule", "https://wheeler-centre-heracles.s3.amazonaws.com/wheeler-centre/assets/6c/5b8a80a3ee11e49d6cdf92bba06571/6fbeb2b0a3ee11e48db7d79fc768dea7_content_medium.jpg", "I am a regular commentator on the early work of VNS Matrix and cyber-feminism new media art. Cyberfeminism was about ideas, irony, appropriation and hands-on skilling up in the data terrain. It combined a utopic vision of corrupting patriarchy with an unbounded enthusiasm for the new tools of technology. It embraced gender and identity politics, allowing fluid and non-gendered identities to flourish through the digital medium. The post-corporeal female would be an online frontier woman, creating our own virtual worlds and colonizing the amorphous world of cyberspace. Python. Ruby.", "F", "55", "3, 3, 5, 5, 5, 2, 1, 3, 3, 3, 5, 4, 4, 5, 5", "BASIC"), ("Ada Lovelace", "EnchantressOfNumbers", "http://blogs.bodleian.ox.ac.uk/wp-content/uploads/sites/163/2015/10/AdaByron-1850-1000x1200-e1444805848856.jpg", "Mathematician, first programmer.  Member of Royal Astronomical Society.  I like walks in the park and writing algorithms for the Analytical Engine to compute Bernoulli numbers.", "F", "36", "4, 3, 2, 4, 2, 1, 3, 5, 4, 3, 2, 3, 4, 2, 4", "Java"), ("Margaret Hamilton", "MathMaggie", "https://upload.wikimedia.org/wikipedia/commons/d/db/Margaret_Hamilton_-_restoration.jpg", "Mathematician, programmer for NASA.  I like reading books and sending men to the moon.", "F", "30", "4, 1, 2, 3, 5, 4, 3, 2, 3, 4, 2, 3, 2, 1, 3", "C#"), ("Bjarne Stroustrup", "Cplusplus", "http://www.arkhitech.com/wp-content/uploads/2015/04/Bjarne-Stroustrup.jpg", "Danish computer scientist.  I am a total nerd, because I created and evolved C++.  I love to teach computer science to other glorious nerds.", "M", "55", "2, 5, 4, 3, 2, 3, 4, 1, 4, 3, 2, 3, 2, 3, 2", "Objective-C"), ("Anita Borg", "SysterCyBorg","https://upload.wikimedia.org/wikipedia/en/e/e1/Anita_Borg.jpg", "Computer scientist. I have a PhD and ran the Grace Hopper school of programming, as well as a number of nonprofits.  I am a huge advocate for women in tech because we are seriously underrepresented.  In my free time, I like to knit and build fault tolerant Unix-based operating systems.", "F", "54", "5, 3, 2, 1, 4, 5, 1, 2, 4, 3, 5, 4, 3, 2, 3", "JavaScript"), ("Angela Yu", "AngelaBrews", "https://pbs.twimg.com/profile_images/744849215675838464/IH0FNIXk_400x400.jpg", "Owner of The App Brewery.  I am a licensed physician who didn't like the way medicine worked, so I quit to pursue my lifelong passion of coding.  I now teach a number of courses in London, from iOS app building courses to a Software Development Bootcamp. I like feeding the ducks at the park and building beautiful websites.", "F", "35", "3, 2, 4, 1, 2, 3, 2, 4, 5, 4, 3, 2, 4, 4, 1", "SQL"), ("Ellen Ullman", "CodingLinguist", "https://assets.pcmag.com/media/images/567765-ellen-ullman.jpg?thumb=y&width=980&height=500", "I am a former software engineer. I started programming in the late 1970s almost by chance. I had witnessed first-hand the rise of the internet. 20 years of coding later, I am a writer and technology commentator.  I wrote a memoir in 1997 titled Close to the Machine: Technophilia and its Discontents, which is often described as a ‘cult classic’.  Among many languages, C is my favorite, I can debug it on the phone.", "F", "69", "3, 5, 4, 2, 1, 5, 3, 4, 5, 3, 4, 3, 2, 1, 4", "C/C++"), ("Susan Wojcicki", "Brainy94066", "http://bit.ly/2Ijm4nV", "I am a Silicon Valley native, born and bred there. I have been the CEO of YouTube since February 2014. I was involved in the founding of Google, and became Google's first marketing manager in 1999. I  was in charge of Google's original video service, and after observing the success of YouTube, proposed the acquisition of YouTube by Google in 2006.  Lots of folks don’t know this, but Larry Page and Sergei Bryn started Google in my garage.", "F", "50", "3, 4, 2, 5, 4, 2, 1, 2, 5, 3, 4, 5, 3, 2, 3", "Objective-C");










